import React from "react";
import "./styles.css";
import HomePage from "./Pages/HomePage";
import Contact from "./Pages/Contact";
import About from "./Pages/About";
import Referances from "./Pages/Referances";
import Brands from "./Pages/Brands";
import Products from "./Pages/Products";
import Header from "./Components/Header/Header";
import { Route, Switch, Link } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";
import Footer from "./Components/Footer/Footer";
import ProductDetail from "./Pages/ProductDetail";

export default function App() {
  let products = [
    { name: "anil", id: 1 },
    { name: "peter", id: 2 },
    { name: "bruce", id: 3 },
    { name: "tony", id: 4 },
  ];
  return (
    <div style={{ overflow: "hidden" }}>
      <Router>
        <Header />

        {products.map((item) => (
          <div>
            <Link to={"/product/" + item.id + "/" + item.name}>
              {item.name}
            </Link>
          </div>
        ))}
        <Switch>
          <Route path="/user/:id/:name" render={(props) => <ProductDetail {...props} />}/>

          <Route exact from="/" render={(props) => <HomePage {...props} />} />
          <Route
            exact
            path="/contact"
            render={(props) => <Contact {...props} />}
          />
          <Route
            exact
            path="/brands"
            render={(props) => <Brands {...props} />}
          />
          <Route exact path="/about" render={(props) => <About {...props} />} />
          <Route
            exact
            path="/products"
            render={(props) => <Products {...props} />}
          />
          <Route
            exact
            path="/referances"
            render={(props) => <Referances {...props} />}
          />
        </Switch>

        <Footer />
      </Router>
    </div>
  );
}
